import React, { Component } from 'react';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import { IconButton, TableRow, Container, Button } from '@material-ui/core';

class Navbar extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-dark bg-dark">
                <h2 style={{color:"white",fontFamily:"papyrus"}}>EGBA Sistem</h2>
                <IconButton edge="right" aria-label="Add" onClick={this.showModal} style={{  float:"right",display: 'inline-block', margin: 'auto' ,}}>
                                    <AccountCircleIcon style={{blockSize:"30",color:"white",fontSize:"2.5rem"}} />
                </IconButton>
                </nav>
            </div>
        )
    }
}
export default Navbar;
